import { useHistory } from 'react-router-dom';

export default function Header() {
    const history = useHistory();

    const handleAboutClick = () => {
        history.push('/history');
    };

    return (
        <header>
            <div className='logo-container'>
                <img src='https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG' alt='AC Milan Logo' className='logo-img' />
                <span className='logo-text'>AC Milan</span>
                <ul className='nav'>
                    <li onClick={handleAboutClick}>Про клуб</li>
                    <li>Основна команда</li>
                    <li>Молодіжна команда</li>
                </ul>
            </div>
            <div className='presentation'></div>
        </header>
    )
}
